gKd(){return"Profissional de TI com forma\xe7\xe3o em Sistemas da Informa\xe7\xe3o pelo Cotemig e especializa\xe7\xe3o em linguagem Java pela Oracle. Possui experi\xeancia como t\xe9cnico de TI e posteriormente empreendeu na \xe1rea de academias. Retornou ao desenvolvimento e aprimorou habilidades em Front-end, incluindo HTML, PHP, CSS, JavaScript, UI/UX e desenvolvimento web."},
gKe(){return"Descobri a paix\xe3o por Flutter em 2020, tornando-me um profissional Full-Stack capaz de desenvolver aplica\xe7\xf5es mobile do zero ao produto final. Na Exacology, atuei como desenvolvedor Android, assumindo grandes responsabilidades apos a saida do Senior. Procuro novas oportunidades para aplicar minhas habilidades em projetos desafiadores."},
gSC(){return"Contato"},
gWc(){return"PROJETOS"},
gWf(){return"No projeto, desenvolvi o front-end seguindo os princ\xedpios de clean code e a arquitetura MVC/MVVM. Minhas responsabilidades inclu\xedam o planejamento e a execu\xe7\xe3o de funcionalidades complexas, bem como a proposi\xe7\xe3o de melhorias tecnol\xf3gicas para o sistema. Atuei como coordenador do desenvolvimento, trabalhando em conjunto com a equipe de backend, designer e gerente de produto. Utilizamos ferramentas de versionamento como o Git e adotamos metodologias \xe1geis, como o Scrum. O aplicativo contava com tr\xeas se\xe7\xf5es principais: um Chat, \xe1rea de testes psicol\xf3gicos e listas de usu\xe1rios em categorias diversas, proporcionando aos usu\xe1rios uma maneira de avaliar suas conex\xf5es al\xe9m da apar\xeancia inicial. Um grande desafio nesse projeto foi meu primeiro contato com webSocket, onde eu implementei do zero todo o chat a partir de um servidor WS integrado com uma API escrita em python onde armazenava as mensagens enviadas no banco de dados."},
gWg(){return"O projeto em desenvolvimento utiliza a linguagem Dart e conta com a colabora\xe7\xe3o de veterin\xe1rios para criar um aplicativo que armazena e organiza informa\xe7\xf5es sobre locais de trabalho e os pacientes atendidos nesses locais. O objetivo \xe9 facilitar a gera\xe7\xe3o de documentos di\xe1rios, como laudos de plant\xe3o, laudos cl\xednicos e receitu\xe1rios. A ideia \xe9 que, no futuro, essas informa\xe7\xf5es possam ser compartilhadas entre os usu\xe1rios da rede do aplicativo. Atualmente, o app ainda n\xe3o est\xe1 dispon\xedvel na Play Store."},
